import React from "react";

const Template1 = ({ resume }) => {
  const {
    first_name,
    last_name,
    phone_number,
    address,
    designation,
    email,
    city,
    description,
  } = resume.about;
  const {
    school,
    degree,
    school_city,
    education_start_date,
    education_end_date,
    education_description,
  } = resume.education;
  //   const {
  //     job_title,
  //     employeer,
  //     location,
  //     experience_start_date,
  //     experience_end_date,
  //     experience_description,
  //   } = resume.experince;
  //   const { project_title, project_link, project_description } = resume.project;
  //   const { achievement_title, achievement_description } = resume.achivements;

  return (
    <div className="flex justify-start w-[60%] mt-4  items-start">
      <div className="flex bg-[#353535] h-screen  text-white flex-col p-10 basis-[35%] ">
        <div className="underline">CONTACT</div>
        <div>{phone_number}</div>
        <div>{email}</div>
        <span>
          {address}
          {city}
        </span>
        <div className="underline">EDUCATION</div>
        <div>{school}</div>
        <div>{school_city}</div>
        <div>{degree}</div>
        <span>
          {education_start_date}
          {education_end_date}
        </span>
        <div> {education_description}</div>
      </div>
      <div className="flex flex-col w-[700px] gap-8 p-10 ">
        <div>
          <div className="text-2xl flex">
            <div>{first_name}</div>
            <div>{last_name}</div>
          </div>
          <div>
            <div className="text-xl mb-2"> {designation}</div>

            <div>{description}</div>
          </div>
        </div>
        <div>
          <div className="underline text-xl">ACHIVEMENT</div>
        </div>
      </div>
    </div>
  );
};

export default Template1;
